create table Flights
(
    ID               int  not null
        primary key,
    Routes_flight_nr int  not null,
    Aircrafts_ID     int  not null,
    flight_date      date not null,
    constraint Flights_Aircrafts
        foreign key (Aircrafts_ID) references Aircrafts (ID),
    constraint Flights_Routes
        foreign key (Routes_flight_nr) references Routes (flight_nr)
);

